Прямой работодатель #Администратор
#Работа #Москва Юноши и Девушки
⠀
В нашу компанию "КвесКвест"требуются веселые, активные парни и девушки на должность администратора.
Вам нужно будет:
- Встречать и провожать гостей;
- Презентовать квесты компании, возможности проведения праздников и различные сувениры;
- Вести учет игр;
- Проводить инструктаж игроков;
- Принимать оплату у гостей и вести учет выручки.
Ты нам подходишь если:
- Можно без опыта, главное желание работать;
- Улыбаться;
- Умеешь располагать к себе в диалоге;
- Умеешь планировать свой рабочий день;
- Коммуникабельность, честность, общительность, креативность.
Условия:
- График 5/2, рабочий день 9 часов;
- Предусмотрено обучение, поэтому можно без опыта;
- Возможность карьерного роста;
- Работа в молодом дружном коллективе;
- Оплачиваемая стажировка;
- Достойная зарплата, 2800р выход, выплаты ежедневно или еженедельно.
По вопросам работы не стесняйтесь пишите в личные сообщения:
